import React from "react";

const Footer = () => {
  return (
    <div>
      <ul>
        <li className="info"></li>
        <li className="link"></li>
        <li className="legal"></li>
        <li className="contactMe"></li>
        <li className="copy"></li>
      </ul>
    </div>
  );
};

export default Footer;
